import { colors } from '../theme';

const sliderData = [
    {
        id: 1,
        image: require('../assets/images/slider/slider-1.jpg'),
        title: 'Find the Right Online \nTutor For You.',
        percentage: '-40%',
        color:colors.white,
    },
    {
        id: 2,
        image: require('../assets/images/slider/slider-2.jpg'),
        title: 'Discover your \nFuture with us',
        percentage: '-50%',
        color:colors.black,
    },
    {
        id: 3,
        image: require('../assets/images/slider/slider-3.jpg'),
        title: 'Find the Right Online \nTutor For You.',
        percentage: '-60%',
        color:colors.black,
    },
]

export default sliderData;
